import React from "react";
import "style.css";

function LoginForm() {
  return (
    <div className="col-md-4 loginContainer">
      <form class="form login-form login">
        <div class="form-group">
          <label for="email-login">email:</label>
          <input class="form-input" type="text" id="email-login" />
        </div>
        <div class="form-group">
          <label for="password-login">password:</label>
          <input class="form-input" type="password" id="password-login" />
        </div>
        <div class="form-group">
          <button id="signup" class="btn btn-primary" type="submit">
            login
          </button>
          <a href="signup">Sign up here</a>
        </div>
      </form>
    </div>
  );
}

export default LoginForm;
